<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>College Filter Tool</title>
  <!-- Tailwind CSS CDN -->
  <script src="https://cdn.tailwindcss.com"></script>
  <style>
    /* Custom scrollbar for checkboxes */
    .checkboxes::-webkit-scrollbar {
      width: 8px;
    }
    .checkboxes::-webkit-scrollbar-track {
      background: #f1f1f1;
      border-radius: 10px;
    }
    .checkboxes::-webkit-scrollbar-thumb {
      background: #888;
      border-radius: 10px;
    }
    .checkboxes::-webkit-scrollbar-thumb:hover {
      background: #555;
    }
  </style>
</head>
<body class="font-sans bg-gray-100 min-h-screen flex flex-col">
  <div class="container mx-auto px-4 py-8 flex-grow">
    <h1 class="text-3xl md:text-4xl font-bold text-center text-blue-600 mb-8">College Filter Tool</h1>

    <form method="POST" class="bg-white p-6 md:p-8 rounded-lg shadow-lg max-w-xl mx-auto">
      <div class="mb-6">
        <label for="city" class="block text-gray-700 text-sm font-semibold mb-2">Select City:</label>
        <select name="city" id="city" required
                class="block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 sm:text-sm">
          <option value="" disabled selected>-- Choose City --</option>
          {% for city in cities %}
            <option value="{{ city }}">{{ city }}</option>
          {% endfor %}
        </select>
      </div>

      <div class="mb-6">
        <label class="block text-gray-700 text-sm font-semibold mb-2">Select Branches:</label>
        <div class="checkboxes grid grid-cols-1 sm:grid-cols-2 gap-x-4 max-h-56 overflow-y-auto border border-gray-300 rounded-md p-4 bg-white shadow-sm">
          {% for branch in branches %}
            <label class="inline-flex items-center text-gray-800 text-sm py-1">
              <input type="checkbox" name="branches" value="{{ branch }}" class="form-checkbox h-4 w-4 text-blue-600 rounded">
              <span class="ml-2">{{ branch }}</span>
            </label>
          {% endfor %}
        </div>
      </div>

      <div class="text-center">
        <button type="submit"
                class="px-6 py-3 bg-blue-600 text-white font-semibold rounded-lg shadow-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition duration-200 ease-in-out">
          Generate Filtered Results
        </button>
      </div>
    </form>

    {% if results %}
      <h2 class="text-2xl md:text-3xl font-bold text-center text-gray-800 mt-12 mb-6">Filtered Results</h2>
      <div class="overflow-x-auto rounded-lg shadow-lg">
        <table class="min-w-full bg-white border border-gray-200">
          <thead class="bg-blue-600 text-white">
            <tr>
              {% for key in results[0].keys() %}
                <th class="py-3 px-4 text-left text-xs font-medium uppercase tracking-wider">{{ key }}</th>
              {% endfor %}
            </tr>
          </thead>
          <tbody class="divide-y divide-gray-200">
            {% for row in results %}
              <tr class="hover:bg-gray-50">
                {% for value in row.values() %}
                  <td class="py-3 px-4 text-sm text-gray-700">{{ value }}</td>
                {% endfor %}
              </tr>
            {% endfor %}
          </tbody>
        </table>
      </div>
    {% endif %}
  </div>

  <footer class="bg-gray-800 text-white text-center py-4 mt-8">
    <p class="text-sm mb-2">Made by Sanyam Chavan</p>
